  templateUrl: './add-patients.component.html',
  styleUrls: ['./add-patients.component.css']
})
export class AddPatientsComponent {
p:Patient=new Patient(0,"","","","","",0,new Date())
constructor(private db:SharedServiceService){}
addUser(){
